jQuery(window).on("elementor/frontend/init",function(){elementorFrontend.hooks.addAction("frontend/element_ready/wpb-countdown.default",function(n){var o=n.find(".wpb-countdown"),t=n.find(".wpb-countdown").data("duedate");if(t)var e=new Date(t).getTime(),i=setInterval(function(){var t=(new Date).getTime(),d=e-t,w=Math.floor(d/864e5),u=Math.floor(d%864e5/36e5),a=Math.floor(d%36e5/6e4),r=Math.floor(d%6e4/1e3);o.find(".wpb-countdown-days .wpb-countdown-value").html(w.toLocaleString(void 0,{minimumIntegerDigits:2})),o.find(".wpb-countdown-hours .wpb-countdown-value").html(u.toLocaleString(void 0,{minimumIntegerDigits:2})),o.find(".wpb-countdown-minutes .wpb-countdown-value").html(a.toLocaleString(void 0,{minimumIntegerDigits:2})),o.find(".wpb-countdown-seconds .wpb-countdown-value").html(r.toLocaleString(void 0,{minimumIntegerDigits:2})),d<0&&(clearInterval(i),o.hide(),n.find(".wpb-countdown-msg").show())},1e3)})});